constructor(type, title, subTitle, author, outline, issue, briefingBody, summary) { //构造函数
        this.type = type;
        this.title = title;
        this.subTitle = subTitle;
        this.author = author;
        this.issue = issue;
        this.outline = outline;
        this.briefingBody = briefingBody;
        this.summary = summary;
    }

axisLabel.formatter:
function (value) {
                    var length = value.length;
                    var labelStr = '';
                    if (length > 25) {
                        var splitNum = Math.ceil(length / 25);
                        if (splitNum === 2) {
                            labelStr = value.substring(0, parseInt(length / 2)) + '\n' + value.substring(parseInt(length / 2))
                        } else {
                            for (var i = 0; i < splitNum; i++) {
                                labelStr += value.substring(i * 25, (i + 1) * 25) + '\n';
                            }
                        }
                    } else {
                        labelStr = value;
                    }
                    return labelStr;
                }

